import ReactDom from "react-dom";

import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";

function App()
{
    ReactDom.render(
        <div>
            <Header />
            <Note />
            <Footer />
        </div>
        ,document.getElementById("root"))
}

export default App;
